/**
 * @param {number[]} deliciousness
 * @return {number}
 */
var countPairs = function (deliciousness = []) {
  let maxNum = deliciousness.reduce((a, b) => Math.max(a, b), 0)
  let maxSum = maxNum * 2
  let numMap = new Map()
  let pairs = 0
  for (let i = 0; i < deliciousness.length; i++) {
    const num = deliciousness[i]
    // console.log(maxSum)
    for (let sum = 1; sum <= maxSum; sum <<= 1) {
      // console.log(sum, num);
      let count = numMap.get(sum - num) || 0
      // console.log(count);
      pairs += count % (Math.pow(10, 9) + 7)
    }
    // console.log(numMap);
    numMap.set(num, (numMap.get(num) || 0) + 1)
  }
  console.log(pairs)
  return pairs 
}

var countPairs2 = function(deliciousness) {
    const MOD = 1000000007;
    let maxVal = 0;
    for (const val of deliciousness) {
        maxVal = Math.max(maxVal, val);
    }
    const maxSum = maxVal * 2;
    let pairs = 0;
    const map = new Map();
    const n = deliciousness.length;
    for (let i = 0; i < n; i++) {
        const val = deliciousness[i];
        for (let sum = 1; sum <= maxSum; sum <<= 1) {
            const count = map.get(sum - val) || 0;
            pairs = (pairs + count) % MOD;
        }
        map.set(val, (map.get(val) || 0) + 1);
    }
    console.log(pairs)
    return pairs;
};

